        "videoDetails": {
            "videoId": "uSohtNwQXuI",
            "title": "Brute Force SSH \u0026 Build a Honeypot Now (Hydra and Cowrie Demo)",
            "lengthSeconds": "742",
            "keywords": ["ssh brute force", "hydra ssh", "cowrie honeypot", "ssh honeypot setup", "network security\ntutorial", "ethical hacking demo", "cisco modeling labs", "devnet sandbox", "pythonvirtualenv", "ssh password cracking", "honeypot logging", "cisco networking academy", "ethical hacking course", "capture the flag", "red team blue team", "ssh", "hydra", "hack", "hacker", "hacking", "red team", "ssh hack", "bruteforce", "password", "wordlist", "passwords", "dictionary", "cyber", "cybersecurity"],
            "channelId": "UCP7WmQ_U4GB3K51Od9QvM0w",
            "isOwnerViewing": false,
            "shortDescription": "Big thank you to Cisco for sponsoring this video and sponsoring my trip to Cisco Live San Diego. \n\nThis video features David Bombal and Kyle Winters demonstrating practical\ncybersecurity techniques. Kyle walks through how to use Hydra to brute force SSH passwords, explaining the process of leveraging wordlists and optimizing the attack. Following the offensive demonstration, Kyle transitions into defensive measures, showing viewers how to quickly and easily set up an SSH honeypot using Cowrie. The honeypot serves as a decoy to attract and monitor malicious actors attempting to access a network. The demonstration includes setting up the honeypot on an Ubuntu host, configuring IP tables for port redirection, and monitoring logs for incoming connection attempts. The video highlights the importance of understanding both attack methods and defensive strategies in cybersecurity. Kyle also mentions free ethical hacking training resources available through Cisco Networking Academy (netacad.com) and future tutorials on Cisco U (u.cisco.com).\n\n// COMMANDS //\nDevices:\nclient 192.168.1.10\nserver 192.168.1.11\nubuntu-honeypot 192.168.1.21\n\nNmap scan:\nnmap -sn 192.168.1.0/24\n\nVerify Hydra installed:\nhydra -h\n\nShow wordlists:\nls -al /usr/share/wordlists/\n\nCrack with known username:\nhydra -l admin -P /usr/share/wordlists/top-passwords-shortlist.txt -t 4 -f ssh://192.168.1.11\n\nCrack with unknown username:\nhydra -L /usr/share/wordlists/top-usernames-shortlist.txt -P /usr/share/wordlists/top-passwords-shortlist.txt -t 4 -f ssh://192.168.1.11\n\nCreate dir for Cowrie:\nmkdir cowrie\ncd cowrie/\n\nClone cowrie:\ngit clone https://github.com/cowrie/cowrie .\n\nLaunch the python virtual environment:\npython3 -m venv cowrie-env\nsource cowrie-env/bin/activate\n\nInstall python requirements:\npip install --upgrade pip\npip install -r requirements.txt\n\nCopy and edit the config:\ncp etc/cowrie.cfg.dist etc/cowrie.cfg\nvi etc/cowrie.cfg\n\nSetup port forwarding for SSH to Cowrie:\nsudo iptables -t nat -A PREROUTING -p tcp --dport 22 -j REDIRECT --to-port 2222\nsudo iptables-save\n\nStart Cowrie:\nbin/cowrie start\n\nCheck Cowrie status:\nbin/cowrie status\n\nView logs:\ntail -f var/log/cowrie/cowrie.log\n\n// MENU //\n0:00 – Introduction\n0:23 – Cisco Modeling Labs (CML) Demo\n01:10 – Alpine Linux \u0026 Hydra\n04:37 – Network Topology\n05:37 – Honeypot Setup\n06:24 – Exploring the CML Sandbox\n08:39 – Configuring Traffic Redirection\n10:42 – Simulating Malicious Access to the Honeypot\n10:58 – Free Ethical Hacking Course\n12:03 – Final Thoughts\n12:20 – Outro\n\n// Kyle Winter’s SOCIALS //\nSocials:  https://www.linkedin.com/in/kyle-m-winters/\nCisco Blogs:  https://blogs.cisco.com/author/kylewinters\n\n// Website REFERENCE //\nhttps://www.netacad.com/courses/ethical-hacker?courseLang=en-US\nhttps://u.cisco.com/\n\n// David's SOCIAL // \nDiscord: https://discord.com/invite/usKSyzb \nX: https://www.twitter.com/davidbombal \nInstagram: https://www.instagram.com/davidbombal \nLinkedIn: https://www.linkedin.com/in/davidbombal \nFacebook: https://www.facebook.com/davidbombal.co \nTikTok: http://tiktok.com/@davidbombal \nYouTube: https://www.youtube.com/@davidbombal\nSpotify:  https://open.spotify.com/show/3f6k6gERfuriI96efWWLQQ\nSoundCloud:  https://soundcloud.com/davidbombal\nApple Podcast:  https://podcasts.apple.com/us/podcast/david-bombal/id1466865532\n\n// MY STUFF //\n https://www.amazon.com/shop/davidbombal \n\n// SPONSORS // \nInterested in sponsoring my videos? Reach out to my team here: sponsors@davidbombal.com\n\nPlease note that links listed may be affiliate links and provide me with a small percentage/kickback should you use them to purchase any of the items listed or recommended. Thank you for supporting me and this channel! \n\nDisclaimer: This video is for educational purposes only.\n\nHack SSH: Crack Passwords, Deploy Honeypots Fast\nCrack SSH Passwords Easily Using Hydra + Wordlists\nBrute Force SSH \u0026 Build a Honeypot Now\nCrack SSH Passwords, Stop Hackers with Honeypots\nBuild a Live SSH Honeypot in Minutes\nHydra in Action: SSH Password Cracking Demo\nCybersecurity Lab: Hack SSH, Defend with Honeypots\nSSH Hacking: Crack Passwords, Setup Honeypots\nHydra + Cowrie: SSH Attack \u0026 Defense Guide\n\n#ssh #hacker #hack",

                "description": {
                    "simpleText": "Big thank you to Cisco for sponsoring this video and sponsoring my trip to Cisco Live San Diego. \n\nThis video features David Bombal and Kyle Winters demonstrating practical\ncybersecurity techniques. Kyle walks through how to use Hydra to brute force SSH passwords, explaining the process of leveraging wordlists and optimizing the attack. Following the offensive demonstration, Kyle transitions into defensive measures, showing viewers how to quickly and easily set up an SSH honeypot using Cowrie. The honeypot serves as a decoy to attract and monitor malicious actors attempting to access a network. The demonstration includes setting up the honeypot on an Ubuntu host, configuring IP tables for port redirection, and monitoring logs for incoming connection attempts. The video highlights the importance of understanding both attack methods and defensive strategies in cybersecurity. Kyle also mentions free ethical hacking training resources available through Cisco Networking Academy (netacad.com) and future tutorials on Cisco U (u.cisco.com).\n\n// COMMANDS //\nDevices:\nclient 192.168.1.10\nserver 192.168.1.11\nubuntu-honeypot 192.168.1.21\n\nNmap scan:\nnmap -sn 192.168.1.0/24\n\nVerify Hydra installed:\nhydra -h\n\nShow wordlists:\nls -al /usr/share/wordlists/\n\nCrack with known username:\nhydra -l admin -P /usr/share/wordlists/top-passwords-shortlist.txt -t 4 -f ssh://192.168.1.11\n\nCrack with unknown username:\nhydra -L /usr/share/wordlists/top-usernames-shortlist.txt -P /usr/share/wordlists/top-passwords-shortlist.txt -t 4 -f ssh://192.168.1.11\n\nCreate dir for Cowrie:\nmkdir cowrie\ncd cowrie/\n\nClone cowrie:\ngit clone https://github.com/cowrie/cowrie .\n\nLaunch the python virtual environment:\npython3 -m venv cowrie-env\nsource cowrie-env/bin/activate\n\nInstall python requirements:\npip install --upgrade pip\npip install -r requirements.txt\n\nCopy and edit the config:\ncp etc/cowrie.cfg.dist etc/cowrie.cfg\nvi etc/cowrie.cfg\n\nSetup port forwarding for SSH to Cowrie:\nsudo iptables -t nat -A PREROUTING -p tcp --dport 22 -j REDIRECT --to-port 2222\nsudo iptables-save\n\nStart Cowrie:\nbin/cowrie start\n\nCheck Cowrie status:\nbin/cowrie status\n\nView logs:\ntail -f var/log/cowrie/cowrie.log\n\n// MENU //\n0:00 – Introduction\n0:23 – Cisco Modeling Labs (CML) Demo\n01:10 – Alpine Linux \u0026 Hydra\n04:37 – Network Topology\n05:37 – Honeypot Setup\n06:24 – Exploring the CML Sandbox\n08:39 – Configuring Traffic Redirection\n10:42 – Simulating Malicious Access to the Honeypot\n10:58 – Free Ethical Hacking Course\n12:03 – Final Thoughts\n12:20 – Outro\n\n// Kyle Winter’s SOCIALS //\nSocials:  https://www.linkedin.com/in/kyle-m-winters/\nCisco Blogs:  https://blogs.cisco.com/author/kylewinters\n\n// Website REFERENCE //\nhttps://www.netacad.com/courses/ethical-hacker?courseLang=en-US\nhttps://u.cisco.com/\n\n// David's SOCIAL // \nDiscord: https://discord.com/invite/usKSyzb \nX: https://www.twitter.com/davidbombal \nInstagram: https://www.instagram.com/davidbombal \nLinkedIn: https://www.linkedin.com/in/davidbombal \nFacebook: https://www.facebook.com/davidbombal.co \nTikTok: http://tiktok.com/@davidbombal \nYouTube: https://www.youtube.com/@davidbombal\nSpotify:  https://open.spotify.com/show/3f6k6gERfuriI96efWWLQQ\nSoundCloud:  https://soundcloud.com/davidbombal\nApple Podcast:  https://podcasts.apple.com/us/podcast/david-bombal/id1466865532\n\n// MY STUFF //\n https://www.amazon.com/shop/davidbombal \n\n// SPONSORS // \nInterested in sponsoring my videos? Reach out to my team here: sponsors@davidbombal.com\n\nPlease note that links listed may be affiliate links and provide me with a small percentage/kickback should you use them to purchase any of the items listed or recommended. Thank you for supporting me and this channel! \n\nDisclaimer: This video is for educational purposes only.\n\nHack SSH: Crack Passwords, Deploy Honeypots Fast\nCrack SSH Passwords Easily Using Hydra + Wordlists\nBrute Force SSH \u0026 Build a Honeypot Now\nCrack SSH Passwords, Stop Hackers with Honeypots\nBuild a Live SSH Honeypot in Minutes\nHydra in Action: SSH Password Cracking Demo\nCybersecurity Lab: Hack SSH, Defend with Honeypots\nSSH Hacking: Crack Passwords, Setup Honeypots\nHydra + Cowrie: SSH Attack \u0026 Defense Guide\n\n#ssh #hacker #hack"
                },

                                "attributedDescription": {
                                    "content": "Wielkie podziękowania dla Cisco za sponsorowanie tego filmu i sponsorowanie mojej podróży na Cisco Live w San Diego. \n\nW tym filmie David Bombal i Kyle Winters demonstrują praktyczne\ntechniki cyberbezpieczeństwa. Kyle pokazuje, jak używać Hydry do siłowego łamania haseł SSH, wyjaśniając proces wykorzystywania list słów i optymalizacji ataku. Po demonstracji ofensywnej Kyle przechodzi do środków obronnych, pokazując widzom, jak szybko i łatwo skonfigurować pułapkę SSH przy użyciu Cowrie. Pułapka służy jako przynęta do przyciągania i monitorowania złośliwych aktorów próbujących uzyskać dostęp do sieci. Demonstracja obejmuje skonfigurowanie pułapki na hoście Ubuntu, skonfigurowanie tabel IP do przekierowywania portów i monitorowanie dzienników pod kątem prób połączeń przychodzących. Film podkreśla znaczenie zrozumienia zarówno metod ataku, jak i strategii obronnych w cyberbezpieczeństwie. Kyle wspomina również o bezpłatnych materiałach szkoleniowych z zakresu etycznego hakowania dostępnych w Cisco Networking Academy (netacad.com) oraz przyszłych samouczkach na Cisco U (u.cisco.com).\n\n// POLECANIA //\nUrządzenia:\nklient 192.168.1.10\nserwer 192.168.1.11\nubuntu-honeypot 192.168.1.21\n\nSkanowanie Nmap:\nnmap -sn 192.168.1.0/24\n\nSprawdź zainstalowaną Hydrę:\nhydra -h\n\nPokaż listy słów:\nls -al /usr/share/wordlists/\n\nCrack ze znaną nazwą użytkownika:\nhydra -l admin -P /usr/share/wordlists/top-passwords-shortlist.txt -t 4 -f ssh://192.168.1.11\n\nCrack ze nieznaną nazwą użytkownika:\nhydra -L /usr/share/wordlists/top-usernames-shortlist.txt -P /usr/share/wordlists/top-passwords-shortlist.txt -t 4 -f ssh://192.168.1.11\n\nUtwórz katalog dla Cowrie:\nmkdir cowrie\ncd cowrie/\n\nKlonuj cowrie:\ngit clone https://github.com/cowrie/cowrie .\n\nUruchom wirtualne środowisko Pythona:\npython3 -m venv cowrie-env\nsource cowrie-env/bin/activate\n\nZainstaluj wymagania Pythona:\npip install --upgrade pip\npip install -r requirements.txt\n\nSkopiuj i edytuj konfigurację:\ncp etc/cowrie.cfg.dist etc/cowrie.cfg\nvi etc/cowrie.cfg\n\nSkonfiguruj przekierowanie portów dla SSH do Cowrie:\nsudo iptables -t nat -A PREROUTING -p tcp --dport 22 -j REDIRECT --to-port 2222\nsudo iptables-save\n\nUruchom Cowrie:\nbin/cowrie start\n\nSprawdź status Cowrie:\nbin/cowrie status\n\nPrzeglądaj logi:\ntail -f var/log/cowrie/cowrie.log\n\n// MENU //\n0:00 – Wprowadzenie\n0:23 – Demonstracja Cisco Modeling Labs (CML)\n01:10 – Alpine Linux i Hydra\n04:37 – Topologia sieci\n05:37 – Konfiguracja honeypot\n06:24 – Eksploracja piaskownicy CML\n08:39 – Konfigurowanie przekierowania ruchu\n10:42 – Symulacja złośliwego dostępu do honeypot\n10:58 – Bezpłatny kurs etycznego hakowania\n12:03 – Podsumowanie\n12:20 – Outro\n\n// MEDIA SPOŁECZNOŚCIOWE Kyle'a Wintera //\nMedia społecznościowe:   / kyle-m-winters  \nBlogi Cisco: https://blogs.cisco.com/author/kylewi...\n\n// ODNOŚNIK DO STRONY INTERNETOWEJ //\nhttps://www.netacad.com/courses/ethic...\nhttps://u.cisco.com/\n\n// SPOŁECZNOŚĆ Davida // \nDiscord:   / discord   \nX:   / davidbombal   \nInstagram:   / davidbombal   \nLinkedIn:   / davidbombal   \nFacebook:   / davidbombal.co   \nTikTok:   / davidbombal   \nYouTube:    / @davidbombal  \nSpotify: https://open.spotify.com/show/3f6k6gE...\nSoundCloud:   / davidbombal  \nApple Podcast: https://podcasts.apple.com/us/podcast...\n\n// MOJE RZECZY //\nhttps://www.amazon.com/shop/davidbombal \n\n// SPONSORZY // \nJesteś zainteresowany sponsorowaniem moich filmów? Skontaktuj się z moim zespołem tutaj: sponsors@davidbombal.com\n\nNależy pamiętać, że wymienione linki mogą być linkami partnerskimi i zapewniają mi niewielki procent/prowizję, jeśli użyjesz ich do zakupu któregokolwiek z wymienionych lub polecanych przedmiotów. Dziękuję za wsparcie mnie i tego kanału! \n\nZastrzeżenie: Ten film ma wyłącznie charakter edukacyjny.\n\nHack SSH: łam hasła, szybko wdrażaj honeypoty\nŁatwe łamanie haseł SSH za pomocą Hydra + Wordlists\nSiła brute'a SSH i zbuduj honeypot teraz\nŁamanie haseł SSH, powstrzymywanie hakerów za pomocą honeypotów\nZbuduj działający honeypot SSH w ciągu kilku minut\nHydra w akcji: demonstracja łamania haseł SSH\nLaboratorium cyberbezpieczeństwa: łamanie haseł SSH, obrona za pomocą honeypotów\nHakowanie SSH: łamanie haseł, konfiguracja honeypotów\nHydra + Cowrie: przewodnik po atakach i obronie SSH\n\n#ssh #hacker #hack",

                                "attributedDescriptionBodyText": {
                                    "content": "Wielkie podziękowania dla Cisco za sponsorowanie tego filmu i sponsorowanie mojej podróży na Cisco Live w San Diego. \n\nW tym filmie David Bombal i Kyle Winters demonstrują praktyczne\ntechniki cyberbezpieczeństwa. Kyle pokazuje, jak używać Hydry do siłowego łamania haseł SSH, wyjaśniając proces wykorzystywania list słów i optymalizacji ataku. Po demonstracji ofensywnej Kyle przechodzi do środków obronnych, pokazując widzom, jak szybko i łatwo skonfigurować pułapkę SSH przy użyciu Cowrie. Pułapka służy jako przynęta do przyciągania i monitorowania złośliwych aktorów próbujących uzyskać dostęp do sieci. Demonstracja obejmuje skonfigurowanie pułapki na hoście Ubuntu, skonfigurowanie tabel IP do przekierowywania portów i monitorowanie dzienników pod kątem prób połączeń przychodzących. Film podkreśla znaczenie zrozumienia zarówno metod ataku, jak i strategii obronnych w cyberbezpieczeństwie. Kyle wspomina również o bezpłatnych materiałach szkoleniowych z zakresu etycznego hakowania dostępnych w Cisco Networking Academy (netacad.com) oraz przyszłych samouczkach na Cisco U (u.cisco.com).\n\n// POLECANIA //\nUrządzenia:\nklient 192.168.1.10\nserwer 192.168.1.11\nubuntu-honeypot 192.168.1.21\n\nSkanowanie Nmap:\nnmap -sn 192.168.1.0/24\n\nSprawdź zainstalowaną Hydrę:\nhydra -h\n\nPokaż listy słów:\nls -al /usr/share/wordlists/\n\nCrack ze znaną nazwą użytkownika:\nhydra -l admin -P /usr/share/wordlists/top-passwords-shortlist.txt -t 4 -f ssh://192.168.1.11\n\nCrack ze nieznaną nazwą użytkownika:\nhydra -L /usr/share/wordlists/top-usernames-shortlist.txt -P /usr/share/wordlists/top-passwords-shortlist.txt -t 4 -f ssh://192.168.1.11\n\nUtwórz katalog dla Cowrie:\nmkdir cowrie\ncd cowrie/\n\nKlonuj cowrie:\ngit clone https://github.com/cowrie/cowrie .\n\nUruchom wirtualne środowisko Pythona:\npython3 -m venv cowrie-env\nsource cowrie-env/bin/activate\n\nZainstaluj wymagania Pythona:\npip install --upgrade pip\npip install -r requirements.txt\n\nSkopiuj i edytuj konfigurację:\ncp etc/cowrie.cfg.dist etc/cowrie.cfg\nvi etc/cowrie.cfg\n\nSkonfiguruj przekierowanie portów dla SSH do Cowrie:\nsudo iptables -t nat -A PREROUTING -p tcp --dport 22 -j REDIRECT --to-port 2222\nsudo iptables-save\n\nUruchom Cowrie:\nbin/cowrie start\n\nSprawdź status Cowrie:\nbin/cowrie status\n\nPrzeglądaj logi:\ntail -f var/log/cowrie/cowrie.log\n\n// MENU //\n0:00 – Wprowadzenie\n0:23 – Demonstracja Cisco Modeling Labs (CML)\n01:10 – Alpine Linux i Hydra\n04:37 – Topologia sieci\n05:37 – Konfiguracja honeypot\n06:24 – Eksploracja piaskownicy CML\n08:39 – Konfigurowanie przekierowania ruchu\n10:42 – Symulacja złośliwego dostępu do honeypot\n10:58 – Bezpłatny kurs etycznego hakowania\n12:03 – Podsumowanie\n12:20 – Outro\n\n// MEDIA SPOŁECZNOŚCIOWE Kyle'a Wintera //\nMedia społecznościowe:   / kyle-m-winters  \nBlogi Cisco: https://blogs.cisco.com/author/kylewi...\n\n// ODNOŚNIK DO STRONY INTERNETOWEJ //\nhttps://www.netacad.com/courses/ethic...\nhttps://u.cisco.com/\n\n// SPOŁECZNOŚĆ Davida // \nDiscord:   / discord   \nX:   / davidbombal   \nInstagram:   / davidbombal   \nLinkedIn:   / davidbombal   \nFacebook:   / davidbombal.co   \nTikTok:   / davidbombal   \nYouTube:    / @davidbombal  \nSpotify: https://open.spotify.com/show/3f6k6gE...\nSoundCloud:   / davidbombal  \nApple Podcast: https://podcasts.apple.com/us/podcast...\n\n// MOJE RZECZY //\nhttps://www.amazon.com/shop/davidbombal \n\n// SPONSORZY // \nJesteś zainteresowany sponsorowaniem moich filmów? Skontaktuj się z moim zespołem tutaj: sponsors@davidbombal.com\n\nNależy pamiętać, że wymienione linki mogą być linkami partnerskimi i zapewniają mi niewielki procent/prowizję, jeśli użyjesz ich do zakupu któregokolwiek z wymienionych lub polecanych przedmiotów. Dziękuję za wsparcie mnie i tego kanału! \n\nZastrzeżenie: Ten film ma wyłącznie charakter edukacyjny.\n\nHack SSH: łam hasła, szybko wdrażaj honeypoty\nŁatwe łamanie haseł SSH za pomocą Hydra + Wordlists\nSiła brute'a SSH i zbuduj honeypot teraz\nŁamanie haseł SSH, powstrzymywanie hakerów za pomocą honeypotów\nZbuduj działający honeypot SSH w ciągu kilku minut\nHydra w akcji: demonstracja łamania haseł SSH\nLaboratorium cyberbezpieczeństwa: łamanie haseł SSH, obrona za pomocą honeypotów\nHakowanie SSH: łamanie haseł, konfiguracja honeypotów\nHydra + Cowrie: przewodnik po atakach i obronie SSH\n\n#ssh #hacker #hack",
